window.testForPattern = (pattern = {len: 8, repeatPos: [1, 3, 5]}, words = ['']) => {
    const hits = [];
    console.log(pattern);
    for (const word of words) {
        if (!pattern.len && pattern.repeatPos) pattern.len = pattern.repeatPos[pattern.repeatPos.length - 1];
        else if (!pattern.len && !pattern.repeatPos) pattern.len = 3;

        if (word.length === pattern.len) {
            console.log('WORD:  ', word, word.length)
            const positions = [];
            let matches = true;
            if (pattern.repeatPos.length > 0) {
                const firstPos = word[pattern.repeatPos[0]];

                for (const pos of pattern.repeatPos) {
                    positions.push(word[pos]);
                }

                for (const [i, letter] of positions.entries()) {
                    if (letter !== firstPos) {
                        matches = false;
                    }
                }
            }

            if (matches) hits.push(word);
        }
    }

    if (window.doFindPattern) {
        document.querySelector('#patternResult').classList.remove('hidden');
    } else {
        document.querySelector('#patternResult').classList.add('hidden');
    }

    let result = '';
    for (const hit of hits) result += hit + '\n';
    if (hits.length === 0) result = 'No Matches'
    document.querySelector('#patternResult').value = result;
}
